import React from "react";
import './scroll.css'



const Scroll =(props)=>{
    return (
        <div class='wrapper'>
            <div class='shadow shadow--top'></div> 
            <div class='shadow shadow--bottom'></div> 
            <div class='content'>
            {props.children}
            </div>
        </div>
    )

};

export default Scroll;
